import { useEffect, useState } from 'react';
import './App.css';

function App() {

  const [users, setUsers] = useState([])

  useEffect(() => {
    fetch('http://127.0.0.1:8000/users/', {
      'method': 'GET',
      headers: {
        'Content-Type': 'application/json',
        'Authorization': 'Token e12876a2eb51aad4ae21f625b577e45970914967'
      }
    })
    }
  )

  return (
    <div className="App">

    </div>
  );
}

export default App;
